{'videoId': 'LPAh38eBD6M', 'topLevelComment': {'kind': 'youtube#comment', 'etag': 'ZXlVLRwthSsWegRFxmk6EdJsa8U', 'id': 'UgxvB30wfoHtK6g2j7J4AaABAg', 'snippet': {'videoId': 'LPAh38eBD6M', 'textDisplay': 'Interrompendo a festa com os sertanejos Caro Sr Presidente, eu fico me pergunando como é interessante o passado e as consequências políticas geradas por guerras entre partidos que ocorreram nos anos 90 até   os anos 20, semelhantes a uma guerra fria, desde o Psdb 1998, até os dias atuais, crianças de escolas públicas, professoras, e outros órgãos semelhantes foram atacados fisica e psicologicamente através de meios sórdidos, repugnantes de se explicar, mas ainda não é só o começo da ênfase do comentário, já que, pergunto-me &quot;o que se pode esperar de uma sociedade que está sujeita a permanecer vitima desta guerra silenciosa que chamamos de: (politica) ?<br>Bom Caro Sr. Presidente, entre o bem e o mal está a escolha de apertar algumas teclas e eleger alguém novamente que faça novas promessas desde a fundação do presidencialismo imposto no Brasil acreditando em novas mudanças, mas sabendo-se que aqueles que moram em regiões periféricas sabem bem que isso é como uma religião que você acredita estar certo, tem suas particularidades, é contra o outro lado, porém a forma de cultuação é a mesma.<br><br>Uma pergunta mimha: &quot;O povo é realmente livre?&quot;, quer dizer... se temos o direito de ir, vir e ficar em territorio nacional em tempos de paz com nosso corpo e bens, isso demonstra que somos donos de nós mesmos, mas a curiosidade começa quando as eleições chegam e o povo é obrigado a votar e se não votar perde dinheiro,  fica mal para o governo e outras hipocrisias contemporaneas, caro sr Presidente, é lamentável as cosequencias do Brasil Atual, nada mudou a não ser o ecossistema e as paisagens, porque até eu fui e continuo sendo assim como todos os outros cidadãos Brasileiros vitima e escravo dessa politica que para o povo nada mais é do que um meio de gerar lucros, não tenho aqui uma opinião mais positiva e sim negativa e espero que entenda que a realidade é outra, tanto que os inocentes do passado estão sendo atacados constantemente por ai e ninguém dá a minima.. se você realmente se acha digno de continuar na presidencia, ao menos leve em consideração o povo e sua devida liberdade que atualmente ainda continua a não existir.', 'textOriginal': 'Interrompendo a festa com os sertanejos Caro Sr Presidente, eu fico me pergunando como é interessante o passado e as consequências políticas geradas por guerras entre partidos que ocorreram nos anos 90 até   os anos 20, semelhantes a uma guerra fria, desde o Psdb 1998, até os dias atuais, crianças de escolas públicas, professoras, e outros órgãos semelhantes foram atacados fisica e psicologicamente através de meios sórdidos, repugnantes de se explicar, mas ainda não é só o começo da ênfase do comentário, já que, pergunto-me "o que se pode esperar de uma sociedade que está sujeita a permanecer vitima desta guerra silenciosa que chamamos de: (politica) ?
Bom Caro Sr. Presidente, entre o bem e o mal está a escolha de apertar algumas teclas e eleger alguém novamente que faça novas promessas desde a fundação do presidencialismo imposto no Brasil acreditando em novas mudanças, mas sabendo-se que aqueles que moram em regiões periféricas sabem bem que isso é como uma religião que você acredita estar certo, tem suas particularidades, é contra o outro lado, porém a forma de cultuação é a mesma.

Uma pergunta mimha: "O povo é realmente livre?", quer dizer... se temos o direito de ir, vir e ficar em territorio nacional em tempos de paz com nosso corpo e bens, isso demonstra que somos donos de nós mesmos, mas a curiosidade começa quando as eleições chegam e o povo é obrigado a votar e se não votar perde dinheiro,  fica mal para o governo e outras hipocrisias contemporaneas, caro sr Presidente, é lamentável as cosequencias do Brasil Atual, nada mudou a não ser o ecossistema e as paisagens, porque até eu fui e continuo sendo assim como todos os outros cidadãos Brasileiros vitima e escravo dessa politica que para o povo nada mais é do que um meio de gerar lucros, não tenho aqui uma opinião mais positiva e sim negativa e espero que entenda que a realidade é outra, tanto que os inocentes do passado estão sendo atacados constantemente por ai e ninguém dá a minima.. se você realmente se acha digno de continuar na presidencia, ao menos leve em consideração o povo e sua devida liberdade que atualmente ainda continua a não existir.', 'authorDisplayName': 'Rall Rick', 'authorProfileImageUrl': 'https://yt3.ggpht.com/ytc/AGIKgqOouEPHYTQqSsyIT6FxZZsSb2AHEBMjmwrXVOWc_YjKF6Ez0oELMF6kdtrw4O8h=s48-c-k-c0x00ffffff-no-rj', 'authorChannelUrl': 'http://www.youtube.com/channel/UC-NFPecPMBRoncEFgZE6jgg', 'authorChannelId': {'value': 'UC-NFPecPMBRoncEFgZE6jgg'}, 'canRate': True, 'viewerRating': 'none', 'likeCount': 0, 'publishedAt': '2022-10-17T20:56:41Z', 'updatedAt': '2022-10-17T20:58:55Z'}}, 'canReply': True, 'totalReplyCount': 0, 'isPublic': True}

